eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export */ __webpack_require__.d(__webpack_exports__, {\n/* harmony export */   blogs: () => (/* binding */ blogs)\n/* harmony export */ });\nconst blogs = [\n    {\n        id: \"blog1\",\n        image: \"../Assets/blogs/one.jpg\",\n        heading: \"What is Smart Home Automation? Benefits, Applications And Future Trends\",\n        description: \"Have you ever wondered if your home can be more than just bricks and cement? What if it could adjust its settings intuitively as you need? Imagine a scenario where your home wakes up with youblinds opening, coffee brewing, perfect shower temperature. This is what smart home automation looks like. Isnt it amazing? It is more than just having a bunch of gadgets decked up in your living space. A symphony of sensors, algorithms and connectivity work behind the scenes to make the magic happen. In this article, youll learn about home automation, how it works and its key benefits. Read on to discover the popular applications, challenges, and trends. Discover how to automate your home for modern living.\",\n        data: \"While it is a recent technology, it looks like a huge feat to some people. However, it is less complicated than you think. Let us begin with an understanding of what is home automation. It is a technology that allows you to control your home devices automatically or remotely. You can define and trigger automatic functions for devices like lighting, security, and appliances through rules, scenes or schedules. Rules make a device respond to a certain scenario or an action of yours. For example, a light in your room turns on when you open the door. Scenes let you group devices so that each of them performs a particular action when the scene is triggered. Schedules allow you to pre-define a devices function in certain ways at certain times. For instance, you can schedule the lights in the hall to turn on at dusk. Thus, home automation helps control the working of devices with minimum human intervention. It makes your life more convenient and helps save various costs. \",\n        date: \"March 12, 2025\",\n        slug: \"first-home-buying-tips\",\n        link: \"https://vatikavlante.ebaseinfra.com/\"\n    },\n    {\n        id: \"blog2\",\n        image: \"../Assets/blogs/two.jpg\",\n        heading: \"Commercial Property: What It Is & How to Invest in 2025\",\n        description: \"Have you wondered where business owners set up their stores or offices? It is on commercial properties! From high-rise IT parks to shopping malls and complexes, you can find plenty of examples around. While a residential property provides space for living, a commercial property offers working space and helps generate revenue for the owner. Isnt it a great investment opportunity? Let us find out answers starting with exactly what is commercial real estate. Keep reading to understand the types, risks and challenges involved, how to get started and the options to consider.\",\n        data: \"Let us begin by understanding what is commercial property. Residential and commercial are two major categories of real estate business. A commercial property refers to a real estate property used as a workspace; not a living space. Buildings and spaces used as offices, stores, hotels and warehouses are common examples. Tenants lease a commercial property to run their business. Commercial properties help generate income through rent or business operations, unlike residential spaces. Commercial real estate has a major role in the growth of the economy as it supports businesses and job creation. This real estate business takes care of constructing, marketing, managing, and leasing properties for commercial purposes rather than residential. Investing in a commercial space is a smart financial move, as it offers steady income and long-term growth. However, success depends on understanding different types of commercial properties, market trends, and the right investment strategies.\",\n        date: \"March 5, 2025\",\n        slug: \"interior-design-trends-2023\"\n    },\n    {\n        id: \"blog3\",\n        image: \"../Assets/blogs/three.png\",\n        heading: \"Hidden Costs of Buying an Apartment in 2025\",\n        description: \"Picture this- you find your dream apartment and decide to buy it. You plan the budget taking the apartments price, your income, savings and expenses into account. Just about closing the deal, a series of unknown costs unfold. Instead of envisioning a happy future in the new flat, you suddenly find yourself dealing with a fiscal tug-of-war. It may end up in a budget overrun or rework of your choice. Wouldnt your plan be failproof if you knew the hidden cost of flat ownership? Every homebuyer desires to have clear insights for a hassle-free purchase. If you are planning to buy an apartment in 2025 and want to avoid a last-minute budget crunch, then this article is for you. Keep reading to learn the different subtle expenses that contribute to the final closing payment of an apartment. Some are inevitable costs that homebuyers often overlook or assume to be part of the upfront cost. Foreseeing them helps you make an informed decision. With a smart, wise plan, you can enjoy a worry-free ticket to your dream home, keeping your budget sound.\",\n        data: \"In India, stamp duty is a government-imposed tax on the sale or transfer of a property (including flats). It is calculated as a percentage of the agreement value or the propertys market value, whichever is greater. Besides, a registration fee is levied to register the property in the buyers name. It marks the transaction officially in the government records. Stamp duty and registration fees can vary by state. As of 2024, stamp duty and registration fees in Kerala are set to 8% and 2% respectively. A buyer must look for rates specific to the state where the property is situated. Besides, recent variations in these rates are also likely. Considering these factors is vital to consolidating your apartment registration charges.\",\n        date: \"march 19, 2025\",\n        slug: \"profitable-real-estate-portfolio\",\n        // Example of an external link (optional)\n        link: \"https://vatikavlante.ebaseinfra.com/\"\n    },\n    {\n        id: \"blog4\",\n        image: \"../Assets/blogs/four.jpg\",\n        heading: \"RERA Act: Everything Homebuyers Need to Know\",\n        description: \"When planning to turn your dream of buying a home into reality, its crucial to choose trustworthy developers who offer transparency and legal clarity. The real estate sector in India has been growing rapidly, but it has also faced challenges such as project delays, fraud, and a lack of accountability. To address these issues and safeguard homebuyers, the Indian government introduced the RERA Act in 2016. What is RERA registration, RERA abbreviation, and why is it important? Lets explore its features, benefits, and impact in this blog.\",\n        data: \"The RERA Act came into effect in May 2017, with its primary goal to ensure transparency, reduce fraud, and safeguard the interests of homebuyers. RERA full form is Real Estate (Regulation and Development) Act, 2016. Before RERA, buyers often faced issues like project delays, misleading advertisements, and unfair pricing. With the introduction of this, the government has set guidelines that developers must follow to promote fair practices in the real estate industry. Under the RERA Act 2016, it is compulsory to register any residential or commercial real estate project if the land area exceeds 500 square meters. Hence, this Act is enforced across all states in India, with each state establishing its own regulations to implement it at the local level.\",\n        date: \"march 12, 2025\",\n        slug: \"profitable-real-estate-portfolio\"\n    }\n];\n//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///(ssr)/./data/blogs.js\n");

